              <p class="jobs__details-item">Location&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: NSW 2008 </p><br></br>
              <p class="jobs__details-item">Quotation&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: 1 quotes</p><br></br><br></br>
              <p class="jobs__details-item">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor...</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Maker;
